import React from "react";
import flats from "../datas/data";
import "../styles/Flat-equipment.css"


class EquipmentList extends React.Component {

    constructor(props) {
        super(props)
        console.log(props)
        console.log(flats)
    }

    equipements = flats[this.props.flatNumber].equipments;

    render() {
        return <div className="flat__equipments">
            <ul>
            {this.equipements.map((equipement) =>
                <li className="flat__equipments" key={equipement}> {equipement} </li>
            )}
            </ul>
        </div>
    }
}

export default EquipmentList
